import React from 'react';
import HeaderNavigation from "../headerNavigation";
import Input from "../../components/input";

export default function Home() {

    return (
        <div id={"home"}>
            <HeaderNavigation/>
            <div className="custom-date">
                <Input className={"flex justify-end items-end w-fit inputDate"} type={"date"}/>
                <span className="icon"><img src={"/images/calendar.svg"} alt={""}/></span>
            </div>
        </div>
    );
}
